import React from "react";

function RatingButton({title, }) {
  return (
    <div className="p-3">
      <div>
        <span className="title">Very poor contribution</span>
      </div>
      <div>
        <input type="radio" value="1" name="radioBtn" />
        <span>1</span>
      </div>
    </div>
  );
}

export default RatingButton;
